import React, {Component} from 'react';
import {Form, Button, Input, Message} from 'semantic-ui-react';

class ContributeForm extends Component {


  render() {

    return (
      <Form>
        <Form.Field>
          <label>Amount to Contribute</label>
          <Input
            label='ether'
            labelPosition='right'
          />
        </Form.Field>
        <Button primary>
          Contribute!
        </Button>
      </Form>
    );
  }
}

export default ContributeForm;
